The Big Black River (French: Grande Rivière Noire) is a river crossing the administrative region of Chaudière-Appalaches in Quebec and in Maine. From its source (46°52′38″N 70°10′6″W﻿ / ﻿46.87722°N 70.16833°W), in L'Islet RCM, Quebec, the river runs northeast and east across the Canada–United States border in Maine Township 14, Range 16, WELS, to the Saint John River in Northwest Aroostook T 15, R 13. "Big Black River" flows in: 
*  L'Islet Regional County Municipality: municipality of Sainte-Lucie-de-Beauregard, Quebec, Sainte-Apolline-de-Patton, Quebec, Saint-Adalbert, Quebec, Saint-Marcel, Quebec, Sainte-Félicité, Chaudière-Appalaches, Quebec and Saint-Pamphile, Quebec; 
*  Aroostook County in North Maine Woods, in Maine: from township T14 R18 WELS up to township T15 R14 WELS. Maine's all-time lowest officially verified temperature of −50 °F (−46 °C) was recorded at a weather station along the Big Black River on January 16, 2009. The previous record was −48 °F (−44 °C), set at Van Buren, on January 19, 1925.

Beryozovaya (Russian: Берёзовая) is a river in Perm Krai, Russia, a left tributary of the Kolva River. It is 208 kilometres (129 mi) in length and has a drainage basin covering 3,610 square kilometres (1,390 sq mi). It starts on slopes of mountain range Beryozovy Kamen and flows through Cherdynsky District. Its mouth is downstream of the village Korepino. There are many rocks and limestone formations along its banks. Main tributaries: 
*  Left: Zhernovka; 
*  Right: Byrkim, Vizhai, Buzhui, Kremennaya, Nemyd.
